import BannerAbout from "../../compoments/BannerAbout";
import Collapse from "../../compoments/Collapse";

export default function About() {
    return (
        <div>
            <BannerAbout />
            <div className="collapsesabout">
                <Collapse description="Les annonces postées sur Kasa garantissent une fiabilité totale. Les photos sont conformes aux logements, et toutes les informations sont régulièrement vérifiées  par nos équipes." title="Fiabilité" />
                <Collapse description="La bienveillance fait partie des valeurs fondatrices de Kasa. Tout comportement discriminatoire ou de perturbation du voisinage entraînera une exclusion de notre plateforme." title="Respect" />
                <Collapse description="Nos équipes se tiennent à votre disposition pour vous fournir une expérience parfaite. N'hésitez pas à nous contacter si vous avez la moindre question." title="Service" />
                <Collapse description="Nos équipes se tiennent à votre disposition pour vous fournir une expérience parfaite. N'hésitez pas à nous contacter si vous avez la moindre question." title="Sécurité" />
            </div>
        </div>
    )
}
